import Header from './Header';

const layoutStyle = {
  //margin: 20,
  //padding: 20,
  borderBottom: '1px solid #14a3bb'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default Layout;

